资在,4900-6000元左右。\n三、福利待遇\n1、保险：公司依法为公司员工缴纳上海五险一金；\n2、休假：员工依法享受国家法定节假日、婚假、丧假、产假、带薪年休假等；\n3、贴心的福利：生日礼券、结婚礼金、生育津贴等；\n4、年度各项公司大型活动及丰富多样的社团活动：晚会、运动会、球类比赛、艺文表演；\n5、各项便利设施：室内篮(羽)球场、网吧、图书馆、韵律教室、便利商店、邮局、各式美食餐厅等。\n四、伙食住宿\n1、公司提供伙食补贴360元/月，当月未用金额在薪资中发放，超额自负。生活区内设有大型员工餐厅，可满足多样化的用餐需求；\n2、公司为员工提供宿舍，园区外及园区内宿舍皆采取小区式管理，配备宿舍管理员及安保。\n3、宿舍扣160元住宿费，包含水电费一系列的费用，所有宿舍均提供独立的冷暖空调，无线网等，二十四小时供应洗浴热水及饮用水。\n五、工作时间\n1、正常工作时间：每天8小时，每周5天；\n2、加班时间：平时每日加班不超过3小时，每周至少休息1天；\n3、公司执行白晚班两班制。\n六、入职流程\n由驻厂老师带队前往公司面试报到——录取信息——分发宿舍并放置行李——制作识别卡——新人培训——分发厂服及部门——部门岗前培训——正式上岗！','不限','不限','     包住   五险一金   包吃   年底双薪   周末双休         '),(168,NULL,'6000-12000',' 龙华 ',NULL,'站点爆单急需骑手聘送餐员','送餐员',NULL,NULL,'请看阅读清楚此招聘是公司直招送餐员：（全程没有一分费用）！中介勿扰！\n此岗位为我司全职直营站点招聘，电话初试，条件符合直接安排去找站长。\n配送岗位 送餐员 快递员 配送员 外卖员\n岗位职责：负责站长分配的区域内订单派送。\n任职要求：\n1，身体健康，道路熟悉（有同行经验,退伍兵优先）\n2，年龄45岁以下，有这方面经验优先录用。\nPS;无车人员：优先安排站点的车子，或者租车均可从工资里扣，\n工作时间：早10点到下午2点，晚4点到9点，没有单子下午非送餐高峰期，自由休息\n薪资福利：\n1.底薪3600+提成：\n2.“”保障线不低于4300，路线熟悉综合月薪全部在6000-10000以上！\n3.繁华市区单量多，工资自然更高，上不封顶多劳多得\n4.每月轮休3天。过年过节福利，国家法定假日3倍底薪。\n5.公司给缴纳保险，五险一金，户籍不限\n3、优秀骑手激励奖\n（1）单量王（月完成单量超过1000单）*名奖励300元，第二名奖励200元，第三名奖励100元\n（2）五星好评排名（月完成单量超700单） *名奖励300元，第二名奖励200元，第三名奖励100元\n公司目前提供住宿，和送餐电动车\n目前市区;陆家嘴 黄埔 徐家汇 静安寺 普陀 虹口仅可提供宿舍，\n提醒：此招聘长期有效，且上海有200+个站点，ps就近缺人站点就近分配，目前金山 奉贤等区全满，其他区均有招聘站点?\n陆家嘴分部；北洋泾站世纪公园站塘桥站八佰伴站\n周浦分部；周浦站康桥站浦江站陈行站惠南站\n三林分部；世博园站成山路站三林站御桥站\n张江分部；唐镇站川沙站长泰站曹路站广兰路站王港站\n金桥分部；金桥站博兴站高桥站高行站航津站延长路站\n闸北分部；大宁站彭浦站大场站李子园站真如站大华站中海站灵石路站\n静安分部；静安站长寿路站江苏路站\n曹杨分部；风站环球港站天山站华漕站\n江桥分部；江桥站新泾站丰庄站真北站漕盈站夏阳湖站\n嘉定分部；南翔站陇南站安亭站嘉定东站古北站\n漕河泾分部；上师大站田林站华理站石龙站华泾站\n闵行分部；七莘路站七宝站九亭站漕河泾站龙柏站\n莘庄分部；奉贤站莘庄站南桥站都市站老闵行站西渡站梅陇站\n松江分部松江北站庙前街站开元站泗泾站华阳站金山南站金山北站\n虹口分部；曲阳路站四川北路站和平公园站平凉站江浦站\n宝山分部；共和站富锦站顾村站美兰湖站长江南路站江杨站吴淞站宝杨月浦站堡镇站崇明\n杨浦分部；五角场站中原站隆昌站江湾站\n徐家汇分部；徐家汇站衡山路站陕西南路站打浦桥站新天地站南市站人民广场站','不限','不限','     年底双薪   话补   加班补助   包住    '),(169,NULL,'8000-16000',' 金山 ',NULL,'招送餐员公司直招爆单季节','送餐员',NULL,NULL,'请看阅读清楚此招聘是公司直招送餐员：（全程没有一分费用）！中介勿扰！\n此岗位为我司全职直营站点招聘，电话初试，条件符合直接安排去找站长。\n配送岗位 送餐员 快递员 配送员 外卖员\n岗位职责：负责站长分配的区域内订单派送。\n任职要求：\n1，身体健康，道路熟悉（有同行经验,退伍兵优先）\n2，年龄4